import React from 'react';
import NoticeType from '../model/NoticeType';
import '../style/style.css';

class Notice extends React.Component {
    constructor(props) {
        super(props);
        this.state = {message: props.message, noticeType: props.noticeType};
    }

    render() {
        return (
            <div className={`notice-${this.state.noticeType}-border`}>
                <div className={`${this.state.noticeType}-notice notice`}>
                    <div className="notice-message">{this.state.message}</div>
                    <div className="close-notice"><i class="close icon"></i></div>
                </div>
            </div>
        );
    }
}

export default Notice;
